INSERT INTO `v1_229fea044fdd2bf171a3b6b05c1e520bd000e10556fa8239944e311d5c02ca79` VALUES (24001, 2, 1, 1, 125801, 0, 1, "もうすぐ、みなさまに\nお会いできるのですね。\n胸が高鳴ってしまいます……\n", "リリ", 40011, 321);
INSERT INTO `v1_229fea044fdd2bf171a3b6b05c1e520bd000e10556fa8239944e311d5c02ca79` VALUES (24001, 2, 2, 1, 126001, 0, 1, "初めまして、クリアです♪\nみなさんと一緒に冒険するの\nとっても楽しみにしてます", "クリア", 40011, 322);
INSERT INTO `v1_229fea044fdd2bf171a3b6b05c1e520bd000e10556fa8239944e311d5c02ca79` VALUES (24001, 2, 3, 1, 126101, 0, 1, "んーと。\nこれ、あげる。\nはい", "プレシア", 40011, 323);
INSERT INTO `v1_229fea044fdd2bf171a3b6b05c1e520bd000e10556fa8239944e311d5c02ca79` VALUES (24001, 2, 4, 2, 125801, 0, 1, "あらためまして……\n【アルターメイデン】の\nギルドマスター、リリと申します", "リリ", 40011, 324);
INSERT INTO `v1_229fea044fdd2bf171a3b6b05c1e520bd000e10556fa8239944e311d5c02ca79` VALUES (24001, 2, 5, 2, 126001, 0, 1, "こんにちは、お兄さん♪\n【アルターメイデン】の\nクリアです", "クリア", 40011, 325);
INSERT INTO `v1_229fea044fdd2bf171a3b6b05c1e520bd000e10556fa8239944e311d5c02ca79` VALUES (24001, 2, 6, 2, 126101, 0, 1, "お兄。\nきてくれて、うれしい", "プレシア", 40011, 326);
